  [],\n\t\"revision_timestamp\": \"2016-05-25T00:52:17.167755\",\n\t\"name\": \"airport-movement-area-safety-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Airport Movement Area Safety System
  (AMASS) with Airport Surface Detection Equipment (ASDE) provides controllers with
  automatically generated visual and aural alerts of potential runway incursions and
  other potential unsafe conditions.  AMASS includes the Terminal Automation Interface
  Unit (TAIU) that processes arrival flight data from the Terminal Approach Control
  (TRACON) automation system and beacon target data from the Airport Surveillance
  Radar (ASR) and generates a track. The track is compared with the movement of aircraft
  and ground vehicles on the airport surface based upon surveillance data from the
  Airport Surface Detection Equipment (ASDE-3).  AMASS adds to the ASDE-3 by presenting
  alarms to the tower controllers when evasive action is required. AMASS integrates
  and displays data from ASDE-3 and the ASR. The FAA has installed AMASS at the nation?s
  top 34 airports.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
